ed_user":{"edges":[]},"fact_check_overall_rating":null,"fact_check_information":null,"gating_info":null,"sharing_friction_info":{"should_have_sharing_friction":false,"bloks_app_url":null},"media_overlay_info":null,"media_preview":null,"owner":{"id":"2182369744","username":"rednet_dom"},"is_video":false,"has_upcoming_event":false,"accessibility_caption":"Photo by redNet Dom | Home Design on April 05, 2022. May be an image of furniture and indoor.","edge_media_to_caption":{"edges":[{"node":{"text":"Jednopokojowe mieszkanie typu studio\nDzi\u015b prezentujemy aran\u017cacj\u0119 jednopokojowego mieszkania. Architektom #rednetdom na jednej przestrzeni uda\u0142o si\u0119 sprytnie zorganizowa\u0107 cze\u015b\u0107 kuchenn\u0105 ze sto\u0142em jadalnianym, cz\u0119\u015b\u0107 sypialnian\u0105, mini biuro oraz wygospodarowa\u0107 miejsce do przechowywania.\n\u017beby uzyska\u0107 poczucie wi\u0119kszej przestrzeni nasi projektanci celowo zrezygnowali z wszelkiego rodzaju \u015bcianek dzia\u0142onowych przepierze\u0144, ekran\u00f3w i parawan\u00f3w. Wyj\u0105tkiem jest delikatna \u015bciana z wci\u0105\u017c modnych lameli, kt\u00f3ra oddziela cze\u015b\u0107 sypialnian\u0105 od gabinetu. Wra\u017cenie przestronno\u015bci wzmagaj\u0105 \u015bciany w jednolitym, szarym kolorze oraz szafy z lustrami na frontach, kt\u00f3re dodatkowo optycznie powi\u0119kszaj\u0105 mieszkanie. By unikn\u0105\u0107 aran\u017cacyjnej nudy do wn\u0119trza zosta\u0142y wprowadzone dodatkowe barwy: okleina w kolorze z\u0142otego d\u0119bu oraz czer\u0144.\n\n3D: Krzysztof Ga\u0142ek\n\n#kuchnia #turnkey #mieszkaniepodklucz #architekturawn\u0119trz #interiors #detal #inspiracjewnetrz #polskiewnetrza #3d #salon #interiordesign #dekoracja #wn\u0119trza #livingroomidea #rednetinspiruje #kitchen #wnetrze"}}]},"edge_media_to_comment":{"count":0},"comments_disabled":false,"taken_at_timestamp":1649187002,"edge_liked_by":{"count":13},"edge_media_preview_like":{"count":13},"location":null,"thumbnail_src":"
